import React from 'react';
import { HeaderWrapper, HeaderContainer, CompanyName, ItemContainer, Item, MenuContainer, Login } from './HeaderComponents'
//import Cart from '../assets/icons'

const Header = () => {
  return (
    <HeaderWrapper>
      <HeaderContainer>
        <CompanyName>WISELY</CompanyName>
        <ItemContainer>
          <Item to="#">제품보기</Item>
          <Item to="#">브랜드 스토리</Item>
          <Item to="#">블로그</Item>
          <Item to="#">고객센터</Item>
        </ItemContainer>
        <MenuContainer>
          <Login to="#"></Login>
          <CartWrapper>
            <Cart />
          </CartWrapper>
        </MenuContainer>
      </HeaderContainer>
    </HeaderWrapper>
  );
}

export default Header;
